import { ReactNode } from 'react';
import { ButtonStyled } from './styles';


export interface ButtonProps {
  type?: string;
  onClick?(): void;
  children?: ReactNode;
}

function Button(props: ButtonProps) {
  return (
    <ButtonStyled type={type} onClick={props.onClick}>
      {props.children}
    </ButtonStyled>
  );
}

export default Button;
